import React from 'react'
import { Home } from './Home'
import { Profiles } from './Profiles'
import { Register } from './Register'
import {
    BrowserRouter as Router,
    Switch,
    Route,
} from "react-router-dom";
import { TvShow } from './TvShow';
import { Movies } from './Movies';
import { NavBar } from '../cmps/NavBar';
import { useDispatch } from 'react-redux';
import { setProfile } from '../store/actions/UserAction';


export default function NetflixApp() {
    const dispatch = useDispatch()

    function onChangeProfile(profile) {
        dispatch(setProfile(profile))

    }

    return (
        <Router>
            <div className="netflix-app">
                <NavBar onChangeProfile={onChangeProfile} />

                {/* {netflixId && */}
                <Switch>
                    <Route path="/profile/:id/tv-show" component={TvShow} />
                    <Route path="/profile/:id/movies" component={Movies} />
                    <Route path="/profile/:id" component={Home} />
                    <Route path="/user" component={Profiles} />
                    <Route path="/" component={Register} />
                </Switch>
                {/* } */}

            </div>
        </Router>

    )
}
